// SPDX-License-Identifier: MIT
pragma solidity >=0.5.16;

contract Marketplace {
    string public name;
    uint public realEstateCount = 0;
    // mapping pour stocker les biens sur la blockchain
    mapping(uint => RealEstate) public realEstates;

    struct RealEstate {
        uint id;
        string name;
        uint price;
        uint realEstateType;
        string realEstateAddress;
        uint area;
        string description;
        uint nbroom;
        string sellingDate;
        address payable owner; //Parcqu'on veut payer le propriétaire, utiliser address payable
        bool purchased;
    }

    event RealEstateCreated(
        uint id,
        string name,
        uint price,
        uint realEstateType,
        string realEstateAddress,
        uint area,
        string description,
        uint nbroom,
        string sellingDate,
        address payable owner,
        bool purchased
    );

    event RealEstatePurchased(
        uint id,
        string name,
        uint price,
        uint realEstateType,
        string realEstateAddress,
        uint area,
        string description,
        uint nbroom,
        string sellingDate,
        address payable owner,
        bool purchased
    );

    constructor() public {
        name = "Marketplace";
    }

    function createRealEstate(
            string memory _name, 
            uint _price,
            uint _realEstateType,
            string memory _realEstateAddress,
            uint _area,
            string memory _description, 
            uint _nbroom,
            string memory _sellingDate
        ) public {
        // un nom valide est requis
        require(bytes(_name).length > 0);
        // un prix valide est requis
        require(_price > 0);
        // un type de bien valide est requis
        require(_realEstateType > 0 && _realEstateType< 6 );
        // une adresse de bien valide est requise
        require(bytes(_realEstateAddress).length > 0);
        // une surface valide est requise 
        require(_area > 0);
        // une description valide est requise
        require(bytes(_description).length > 0);
        // un nombre de piece valide est requise
        require(_nbroom > 0);
        // Une date de vente valide est requise
        require(bytes(_sellingDate).length > 0);
        // Increntation du comptage des bien 
        realEstateCount ++;
        // Création des biens
        realEstates[realEstateCount] = RealEstate(
            realEstateCount, 
            _name, 
            _price, 
            _realEstateType, 
            _realEstateAddress, 
            _area, 
            _description, 
            _nbroom, 
            _sellingDate, 
            msg.sender,
            false
        );
        // Declancher un evenement
        emit RealEstateCreated(
            realEstateCount, 
            _name, 
            _price, 
            _realEstateType,
            _realEstateAddress, 
            _area, 
            _description, 
            _nbroom, 
            _sellingDate,  
            msg.sender,
            false
        );
    }


    // fonction payable => elle acceptera que la crypto-monnaie Etherum
    function purchaseRealEstate(uint _id) public payable {
        // cherche le bien
        RealEstate memory _realEstate = realEstates[_id];
        // cherche le proprietaire
        address payable _seller = _realEstate.owner;
        // s'assuerer que le bien à un ID valide
        require(_realEstate.id > 0 && _realEstate.id <= realEstateCount);
        // verifie qu'il y a assez d'ether pour la transtaction
        require(msg.value >= _realEstate.price);
        // verifie que le bien n'a pas déja été acheté
        require(!_realEstate.purchased);
        // vefifie que l'acheteur n'est pas le vendeur 
        require(_seller != msg.sender);
        // transfere la possession du bien à l'acheteur
        _realEstate.owner = msg.sender;
        // tag le bien comme acheté
        _realEstate.purchased = true;
        // met a jour le bien
        realEstates[_id] = _realEstate;
        // envoi l'eth au vendeur 
        address(_seller).transfer(msg.value);
        // Declanche un evenement
        emit RealEstatePurchased(
            realEstateCount, 
            _realEstate.name, 
            _realEstate.price, 
            _realEstate.realEstateType, 
            _realEstate.realEstateAddress, 
            _realEstate.area, 
            _realEstate.description, 
            _realEstate.nbroom, 
            _realEstate.sellingDate, 
            msg.sender, 
            true);
    }

    // write resell function

}
